import Link from 'next/link'

const linkStyle = {
  marginRight: 15
}

const headerWrapper = {
  height: 60,
  position: relative
}

const headerInner = {
  margin: '0 auto',
  padding: '0 10'
}

export default function Header() {
  return (
    <header style={headerWrapper}>
      <div style={headerInner}>
        <Link href="/">
          <a style={linkStyle}>Home</a>
        </Link>
        <Link href="/about">
          <a style={linkStyle}>About</a>
        </Link>
      </div>
    </header>
  )
}
